import React, { useState } from 'react';

const Search = () =>{
    const [img,setImg] = useState("");
    const inputEvent = (event) =>{
        setImg(event.target.value)
    }
    return(
      <>
      <div className="searchbar">
          <input 
          type="text" 
          placeholder="Search anything"
           onChange={inputEvent}
           value={img}   
          />
      </div>

      </>
    );
}

export default Search
